import axios from 'axios'
import React, { useState } from 'react'

const Blogs = () => {
  const [blogs , setBlogs]= useState([])


  const getBlogs = async()=>{
    try {
      const {data} = await axios.get('http://localhost:8081/api/blogs/all-blog')
      if(data.success){
        setBlogs(data.data)
      }
    } catch (error) {
      console.log(error)
    }
  }
  return (
    <div>Blogs</div>
  )
}

export default Blogs
